  inline const ReinforceConfigStatics *ReinforceConfig::__get_statics__()
  {
    const static ReinforceConfigStatics *statics;
  
    if (statics) // Common case
      return statics;

    boost::mutex::scoped_lock lock(dynamic_reconfigure::__init_mutex__);

    if (statics) // In case we lost a race.
      return statics;

    statics = ReinforceConfigStatics::get_instance();
    
    return statics;
  }


